import './perfilUsuario.css'

import React from  'react';

import MainUserInfo from '../mainUserInfo/MainUserInfo';
import ToDosUser from '../todosUsuario/TodosUsuario';


export default function PerfilUsuario(props){
    //logica
    const u = props.user;

    return (
        <div>
            <h1>
                "Profile ",{u.firstName}
            </h1>
            <MainUserInfo usuario={u} ></MainUserInfo>
            <ToDosUser usuario={u}></ToDosUser>
        </div>
    );
}
